import logo from './download.jpg'
import './App.css';
import { ProductAddForm } from './src/components/component_product_add';
import { ProductList } from './src/components/component_product_list';
import { Route, Routes } from 'react-router';
import { AdminLayout } from './src/components/component_admin';

function App(){
    return (
        <div className="container">
            <Routes>
                <Route path="/" element={<AdminLayout/>}>
                    <Route path='products' element={<ProductList/>}/>
                    <Route path='products/new' element={<ProductAddForm/>}/>
                </Route>
            </Routes>
        </div>
    );
}

export default App;
